/**
 * @author : jixiaoyong
 * @description ： 76. 最小覆盖子串
 * 给你一个字符串 s 、一个字符串 t 。
 * 返回 s 中涵盖 t 所有字符的最小子串。如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。
 *
 * 注意：
 * 对于 t 中重复字符，我们寻找的子字符串中该字符数量必须不少于 t 中该字符数量。
 * 如果 s 中存在这样的子串，我们保证它是唯一的答案。
 *
 * 提示：
 * 1 <= s.length, t.length <= 10^5
 * s 和 t 由英文字母组成
 *
 * https://leetcode.cn/problems/minimum-window-substring/
 *
 * @email : jixiaoyong1995@gmail.com
 * @date : 10/22/2022
 */
class MinimumWindowSubstring {


    /**
     * 最长耗时7356.7ms，超时
     */
    val tCharCountMap = hashMapOf<Char, Int>()
    fun minWindow(s: String, t: String): String {
        val sLen = s.length
        val tLen = t.length

        var result = ""
        if (tLen > sLen) {
            return result
        }

        tCharCountMap.clear()
        t.forEach {
            val charCount = tCharCountMap.getOrDefault(it, 0)
            tCharCountMap.put(it, charCount + 1)
        }

        var left = 0
        var right = 1
        val charCountMap = hashMapOf<Char, Int>()
        charCountMap.put(s[left], 1)
        var minWindowSize = Int.MAX_VALUE

        while (left < right) {
            if (sLen - left < tLen) {
                break
            }
            val rightChar = if (right <= sLen - 1) {
                s[right]
            } else {
                right = sLen
                null
            }

            val leftChar = s[left]

            // todo hasT为优化点
            if (!hasT(charCountMap, t)) {
                right++
                if (right > sLen) {
                    break
                }
                rightChar?.let {
                    charCountMap.put(it, charCountMap.getOrDefault(rightChar, 0) + 1)
                }
            } else {
                val windowLen = right - left
                if (windowLen < minWindowSize) {
                    minWindowSize = windowLen
                    result = s.substring(left, right)
                    if (windowLen == tLen) {
                        return result
                    }
                }

                left++
                charCountMap.put(leftChar, charCountMap.getOrDefault(leftChar, 1) - 1)
            }
        }

        return result
    }

    private fun hasT(hashMap: HashMap<Char, Int>, t: String): Boolean {
        t.forEach {
            if (hashMap.getOrDefault(it, 0) < tCharCountMap[it]!!) {
                return false
            }
        }
        return true
    }
}

fun main() {
    val obj = MinimumWindowSubstring()

    val cases = mutableListOf(
//        Pair("a", "a"),// "a"
//        Pair("a", "aa"),// ""
//        Pair("aaa", "aa"),// "aa"
//        Pair("aaaa", "aa"),// "aa"
//        Pair("aa", "aa"),// "aa"
//        Pair("ADOBECODEBANC", "ABC"), // "BANC"
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
        veryLargePair,
    )

    val timeMs = System.currentTimeMillis()
    cases.forEach {
        val result = obj.minWindow(it.first, it.second)
        println("$result --->  s: ${it.first} t: ${it.second}")
    }

    println("*10 耗时${(System.currentTimeMillis() - timeMs) / 1000}s")
}


